import SimpleImageSlider from 'react-simple-image-slider';

function Slider(props) {
    const images = [
        { url: "images/1.jpg" },
        { url: "images/2.jpg" },
        { url: "images/3.jpg" },
        { url: "images/4.jpg" },
        { url: "images/5.jpg" },
        { url: "images/6.jpg" },
        { url: "images/7.jpg" },
    ];
  return <div></div>;
}

export default Slider;
